INSERT INTO `product` VALUES (477614,'iPad 2 16GB WiFi bílý','16GB iPad 2 je ještě více ohromující, je o 33% tenčí a o 15% lehčí. Má dva fotoaparáty pro FaceTime a HD video záznam, dual-core čip A5 a výdrž na baterie až 10 hodin.',9721,'APPLE','apple-ipad-2-white-16gb-wifi','tablety',15682614),(485569,'Oro Light','Nokia Oro Light je elegantní prémiový telefon, na který byly použity materiály jako **zlato, pravá kůže a safírový křišťál.** Dále zaujme 3,5“ AMOLED displejem, velkou vnitřní pamětí, bohatou podporu multimédií či širokou možnosti připojení jako 3G/3,5G sítě, Wi-Fi, Bluetooth. Součástí balení je i **pozlacený headset Nokia BH-806.** Zařízení je z oficiální distribuce pro ČR a má plnou podporu autorizovaných servisů.',27490,'NOKIA','nokia-oro-light','mobily',15706036),(490274,'Gelskin silikonový obal - Samsung Galaxy S2 i9100','Silikonové pouzdro CELLY GELSKIN je vynikající ochrana pro mobilní telefon Samsung Galaxy S2 i9100. Je vyrobeno z tenkého silikonu a přesně na míru daného telefonu. Pouzdro nezakrývá nabíjecí a sluchátkové konektory, lze tedy telefon nabíjet a připojovat příslušenství bez nutnosti telefon vyndat z pouzdra.',189,'CELLY','celly-gelskin-silikonovy-obal-sam-galaxy-s2','pouzdra',15721625),(499055,'Gelskin silikonový obal - iPhone 4S','Silikonová pouzdra CELLY GELSKIN jsou vynikající ochranou pro Váš přístroj. Jsou vyrobena z tenkého silikonu a přesně na míru daného telefonu. Pouzdra nezakrývají nabíjecí a sluchátkové konektory, lze tedy telefon nabíjet a připojovat příslušenství bez nutnosti telefon vyndat z pouzdra. Provedení pouzder je protiskluzové a navržené pro bezproblémové ovládání, je také navrženo pro pohodlné držení telefonu v ruce. Pro maximální ochranu telefonu je vhodné silikonové pouzdro doplnit folií na displej.',189,'CELLY','celly-gelskin-silikonovy-obal-iphone-4s','pouzdra',15747758),(514235,'flipový kryt EFC-1G6FWE pro Galaxy S III (i9300), Marble White','Krásný a stylový **flipový kryt EFC-1G6FWE** pro Galaxy S III i9300, Marble White slouží jako elegantní a praktická ochrana Vašeho Galaxy S III.\n',546,'SAMSUNG','samsung-flipovy-kryt-efc-1g6fwe-galaxy-s-iii','pouzdra',15809715),(514464,'vodotěsné pouzdro pro PDA nebo iPhone 348','Vodotěsné pouzdro **Aquapac Small Whanganui Electronics Case 348** vhodné pro Apple iPhone 3G / iPhone 3GS / PDA / širší modely HTC. Je vodotěsné do hloubky **5m**. Čirá přední strana pouzdra dovoluje používat přístroj bez omezení, a to včetně ovládání dotykovým displejem. Čirý průhled v zadní části pouzdra umožňuje pořizovat fotografie. **Maximální rozměry vloženého předmětu: délka 150mm / obvod 200mm**. Přeměření se provádí dle druhého obrázku v galerii.',490,'AQUAPAC','aquapac-small-whanganui-electronics-case-348','pouzdra',16761410),(514800,'ARNOVA 9 G2 9.7\" 8GB','**ARNOVA 9 G2** v konfiguraci s displejem o velikosti **9.7\"** o rozlišení **1024x768 px**, procesorem **ARM Cortex A8** o frekvenci **1,00 GHz**, **512 MB** operační paměti **RAM**, **8 GB** interní paměti, **Wi-Fi** a operačním systémem **Android 4.0 (Refurbished – tovární dodatečný upgrade Androidu)**, verze **neobsahuje Google Play**, je skvělý tablet pro práci i zábavu, se kterým nuda nemá šanci. Užijte si zábavu naplno!',4999,'ARCHOS','archos-arnova-9-g2-8gb-97','tablety',17379238),(516361,'Sonic Black - II. jakost','**Výrobek je na povrchu lehce poškrábán.**\n\nHuawei Sonic je nástupcem populárního modelu Ideos X5. Přístroj je vybaven 3,5palcovým dotykovým displej, **600MHz procesorem 256 MB operační paměti.** Fotoaparát s rozlišením 3,2MPx pak umožní zachytit oblíbené momentky. Přístroj je v černé barvě. Telefon pochází z **oficiální české distribuce** s českým menu a dokumentací.',2499,'HUAWEI','huawei-sonic-black-ii-jakost','mobily',15749269),(516882,'Gelskin, silikonový obal pro SAMSUNG GALAXY S III I9300, průsvitný','Silikonová pouzdra **CELLY GELSKIN** jsou vynikající ochranou pro Samsung GALAXY S III I9300. Jsou vyrobena z tenkého silikonu a přesně na míru daného telefonu. Pouzdra nezakrývají nabíjecí a sluchátkové konektory, lze tedy telefon nabíjet a připojovat příslušenství bez nutnosti telefon vyndat z pouzdra.',189,'CELLY','celly-gelskin-silikonovy-obal-samsung-i9300','pouzdra',15804206),(521961,'Pouzdro ELEGANCE z ECO kůže, černé, velikost XL, 123x64mm','Stylové a praktické pouzdro **CellularLine** je zhotoveno z kvalitní ECO kůže, vnitřní strana je polstrovaná, chrání displej před poškozením a zároveň ho i leští. Provedení zvyšuje odolnost telefonu proti nechtěným pádům i před stříkající vodou. Pouzdro dále disponuje praktickým páskem napomáhající bezproblémovému vytahování telefonu z pouzdra. Elegance a styl značky CellularLine Vám zajistí pozornost okolí.',374,'CELLULARLINE','cellularline-elegance-z-eco-kuze-cerne-velikost-xl','pouzdra',15819238),(531692,'pouzdro Gelskin pro Apple iPhone 5, černé','Silikonové pouzdro černé **CELLY GELSKIN** je vynikající ochrana pro mobilní telefon **Apple iPhone 5**. Je vyrobeno z tenkého, průsvitného silikonu a přesně na míru daného telefonu. Pouzdro nezakrývá nabíjecí a sluchátkové konektory, lze tedy telefon nabíjet a připojovat příslušenství bez nutnosti telefon vyndat z pouzdra.',189,'CELLY','celly-gelskin-silikonovy-obal-apple-iphone-5-b','pouzdra',15845444),(531823,'pouzdro Gelskin pro Apple iPhone 5, čiré','Silikonové pouzdro čiré **CELLY GELSKIN** je vynikající ochrana pro mobilní telefon **Apple iPhone 5**. Je vyrobeno z tenkého, průsvitného silikonu a přesně na míru daného telefonu. Pouzdro nezakrývá nabíjecí a sluchátkové konektory, lze tedy telefon nabíjet a připojovat příslušenství bez nutnosti telefon vyndat z pouzdra.',189,'CELLY','celly-gelskin-silikonovy-obal-apple-iphone-5-c','pouzdra',15845907),(534642,'Vyklápěcí pouzdro FACE iPhone 5, bílé','**Vyklápěcí pouzdro FACE** určené přesně pro Apple iPhone 5 je v bílém provedení. Chrání displej proti poškození.',413,'CELLY','celly-vyklapeci-pouzdro-face-iphone-5-bile','pouzdra',15853524),(536300,'Halo 8 černý','Mobilní telefon **CPA Halo 8** je vybaven slotem pro paměťové karty a velkým barevným displejem. Dále pak disponuje velkými „mluvícími“ tlačítky pro snadné ovládání. Telefon pochází z oficiální české distribuce s **českým menu a dokumentací.**',1209,'CPA','cpa-myphone-halo-8-cerny','mobily',15862292),(539701,'Galaxy SIII mini Flipové pouzdro EFC-1M7FWEGSTD bílé','**Samsung EFC-1M7FWE** flipové pouzdro je určené pro Samsung Galaxy S III mini. Slouží jako prakticka, kvalitní a stylová ochrana vašeho mobilního telefonu.',505,'SAMSUNG','samsung-flipove-pouzdro-efc-1m7fwegstd-bile','pouzdra',17384429),(539712,'Galaxy S III mini Flipové pouzdro EFC-1M7FBEGSTD modré','**Samsung EFC-1M7FBE** flipové pouzdro je určené pro Samsung Galaxy S III mini. Slouží jako prakticka, kvalitní a stylová ochrana vašeho mobilního telefonu.',489,'SAMSUNG','samsung-flipove-pouzdro-efc-1m7fbegstd-modre','pouzdra',17384401),(539758,'Galaxy S III mini Flipové pouzdro EFC-1M7FYEGSTD žluté','**Samsung EFC-1M7FY** flipové pouzdro je určené pro Samsung Galaxy S III mini. Slouží jako prakticka, kvalitní a stylová ochrana vašeho mobilního telefonu.',514,'SAMSUNG','samsung-flipove-pouzdro-efc-1m7fyegstd-zlute','pouzdra',15943858),(540779,'Gelskin silikonový obal Galaxy SIII Mini','Silikonová pouzdra **CELLY GELSKIN** jsou vynikající ochranou pro Samsung GALAXY S III Mini. Jsou vyrobena z tenkého silikonu a přesně na míru daného telefonu. Pouzdra nezakrývají nabíjecí a sluchátkové konektory, lze tedy telefon nabíjet a připojovat příslušenství bez nutnosti telefon vyndat z pouzdra.',189,'CELLY','celly-gelskin-silikonovy-obal-galaxy-s3-mini','pouzdra',15892402),(540815,'Solid Plus, bílý','**Emporia Solid Plus** je odolný, vodotěsný mobilní telefon do extrémních podmínek. Ideálně pro požívání v dílně, na stavbě, v náročném terénu i v teplotně náročných podmínkách.',2490,'EMPORIA','emporia-solid-plus-bily','mobily',16917363),(544323,'kryt Swarovski iPhone 5, Crystal','Zadní kryt Bling My Thing pro Apple iPhone 5. Pouzdro je vyrobeno s komponenty SWAROVSKI. Jedná se o luxusní a elegantní doplněk vašeho telefonu.',1152,'BLINGMYTHING','blingmything-kryt-swarovski-iphone-5-crystal','pouzdra',15905111),(544329,'kryt Swarovski iPhone 5, Light Rose 2','Zadní kryt Bling My Thing pro Apple iPhone 5. Pouzdro je vyrobeno s komponenty SWAROVSKI. Jedná se o luxusní a elegantní doplněk vašeho telefonu.',980,'BLINGMYTHING','blingmything-kryt-swarovski-iphone-5-light-rose-2','pouzdra',15905157),(544355,'kryt Swarovski iPhone 5, Shadow Crystal Pink Mix','Zadní kryt **Bling My Thing pro Apple iPhone 5**. Pouzdro je vyrobeno s komponenty SWAROVSKI. Jedná se o luxusní a elegantní doplněk vašeho telefonu.',1152,'BLINGMYTHING','blingmything-kryt-swarovski-iphone-5-shadow-crystalp','pouzdra',15905451),(550442,'S7710 Galaxy Xcover 2, Titan Gray','Odolný dotykový telefon s operačním systémem Android 4.1. Přístroj má **certifikaci IP67 a vydrží tak až 30 minut pod hladinou**, je odolný proti prachu, blátu a celkově hrubému zacházení. Dispnouje širokou možností konektivity pomocí **3G, Wi-Fi či Bluetooth. Do výbavy taktéž můžeme zařadit **5 MPx fotoaparát.** Telefon pochází z **oficiální české distribuce** s českým menu a dokumentací.',4961,'SAMSUNG','samsung-s7710-galaxy-xcover-2-black-red','mobily',15925553),(551121,'S7710 Galaxy Xcover 2, Black Red','Odolný dotykový telefon s operačním systémem Android 4.1. Přístroj má **certifikaci IP67 a vydrží tak až 30 minut pod hladinou**, je odolný proti prachu, blátu a celkově hrubému zacházení. Dispnouje širokou možností konektivity pomocí **3G, Wi-Fi či Bluetooth. Do výbavy taktéž můžeme zařadit **5 MPx fotoaparát.** Telefon pochází z **oficiální české distribuce** s českým menu a dokumentací.',4924,'SAMSUNG','samsung-s7710-galaxy-xcover-2-fekete-piros','mobily',15928524),(552603,'ochranné pozdro měkké 4,3\"','Originální univerzální ochranné pouzdro **Garmin** pro využití na navigace s úhlopříčkou displeje 4,3″. Pouzdro je z měkkého a jemného materiálu.',338,'GARMIN'